import { Link } from "react-router-dom";


// Link component is used to create links to different routes.
// The Link component is used in place of the anchor tag.
// The Link component takes a to prop, which is the path that we want to link to.
// The Link component will render an anchor tag in the browser, but it will prevent the default behavior of the anchor tag, which is to request a new page from the server.
// The Link component will change the URL in the browser without reloading the page.
// The Link component is a part of the react-router-dom library.


const Navbar = () => {
  return (
    <nav className="navbar">
      <h1>The Dojo Blog</h1>
      <div className="links">
        <a href="/">Home</a>
        <a href="/create">New Blog</a>
      </div>
    </nav>
  );
}

export default Navbar;
